answer = ifScript();
function ifScript() {
	current.variables.admin_account_name;
	var user = gs.getUser(current.variables.admin_account_name);
	if (user.hasRole('admin') && user.hasRole('security_admin'))
		return 'yes';
	return 'no';
}

